import { useState } from "react";
import Nav from "../components/Nav";

const OnBoarding = () => {

const handleSubmit =() =>{
  console.log("submitted")
}

  return (
    <>
      <Nav minimal={true} setShowModal={() => {}} showModal={false} />
      <div className="onboarding">
        <h2>Create Account</h2>
        <form onSubmit={handleSubmit}>
          <section>
            <label htmlFor="firstName">First Name</label>
            <input
              id="firstName"
              type="text"
              name="firstName"
              placeholder="First Name"
              required={true}
              value={""}
              onChange={handleChange}
            ></input>
            <div className="multipleInputContainer">
              <label>Birthday</label>
              <input
                id="dobDay"
                type="number"
                name="dobDay"
                placeholder="DD"
                required={true}
                value={""}
                onChange={handleChange}
              ></input>
              <input
                id="dobMonth"
                type="number"
                name="dobMonth"
                placeholder="MM"
                required={true}
                value={""}
                onChange={handleChange}
              ></input>
              <input
                id="dobYear"
                type="number"
                name="dobYear"
                placeholder="YYYY"
                required={true}
                value={""}
                onChange={handleChange}
              ></input>
            </div>
            <label>Gender</label>
            <input
              id="manGenderIdentity"
              type="radio"
              name="genderIdentity"
              value={"man"}
              onChange={handleChange}
            ></input>
                        <label htmlFor="manGenderIdentity">Man</label>
            <input
              id="womanGenderIdentity"
              type="radio"
              name="genderIdentity"
              value={"woman"}
              onChange={handleChange}
            ></input>
                        <label htmlFor="womanGenderIdentity">Woman</label>
            <input
              id="elseGenderIdentity"
              type="radio"
              name="genderIdentity"
              value={"else"}
              onChange={handleChange}
            ></input>
                        <label htmlFor="elseGenderIdentity">Else</label>
            <div className="multipleInputContainer"></div>

            <label htmlFor="showGender">Show gender on my profile</label>
            <input
              id="showGender"
              type="checkbox"
              name="showGender"
              onChange={handleChange}
              checked={false}
            ></input>
          </section>
        </form>
      </div>
    </>
  );
};

export default OnBoarding;
